import { Link } from "react-router-dom";

const NavBar = () =>{

  return(
    <nav style={{padding: "1rem", backgroundColor: "#eee"}}>
      <link to = "/">Home</link> | {" "}
      <link to = "/post/new">New Post</link> | {" "}
      <link to = "/login">Login</link> | {" "}
      <link to = "/register">Register</link>
    </nav>
  );
}

export default NavBar;
